import React from 'react';

class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: ''
    };
}

render() {
  return (
    <div className="header">
      Register Page
      {console.log("Hello World")}
    </div>
  );
}
}
export default Register;
